import * as FaIcons from "react-icons/fa";
import * as AiIcons from "react-icons/ai";
import * as IoIcons from "react-icons/io";
import {
  FcOnlineSupport,
  FcComments,
  FcGlobe,
  FcSelfServiceKiosk,
} from "react-icons/fc";
export const SidebarData = [
  {
    title: "Dashboard",
    path: "/dashboard",
    icon: <AiIcons.AiFillHome />,
    cName: "nav-text",
  },
  {
    title: "Compiler",
    path: "/compiler",
    icon: <FcSelfServiceKiosk />,
    cName: "nav-text",
  },
  {
    title: "Community",
    path: "/community",
    icon: <FcGlobe />,
    cName: "nav-text",
  },
  {
    title: "Messages",
    path: "/chat",
    icon: <FcComments />,
    cName: "nav-text",
  },
  {
    title: "Support",
    path: "/contactUs",
    icon: <FcOnlineSupport />,
    cName: "nav-text",
  },
];
